//=======================================================
// HTML5 FUN 題庫設定檔 poke 戳戳樂
//=======================================================

//------------------------------
// 對話框的標題字
//------------------------------
title = '戳戳樂';


//------------------------------
// 文字的字體名稱
//------------------------------
font = '標楷體 , BiauKai';

//------------------------------
// 是否在格子的左上角顯示格子的編號
// 0: 不顯示  1:顯示編號
//------------------------------
showNumber = 0;

//------------------------------
//格子左上角編號的字形大小
//(相對於格子的大小, 0~1 之間的數字)
//------------------------------
numberLabelFontSizeScale = 0.4;

//------------------------------
// 戳洞時的音效，預設的音效為南投縣永興國小江明勳老師提供
//
//soundFilename = '20100412-poke-1.mp3';
//
// MP3 base64 encode tools
// 		https://codepen.io/xewl/pen/NjyRJx
//------------------------------
soundFilename = 'data:audio/mp3;base64,';

//------------------------------
// paper 未戳前,洞口圖檔的目錄路徑(相對於程式所在的目錄)
//------------------------------
mediaFolder = 'data';

//------------------------------
// 每一洞上可使用的圖檔檔名清單
// 以欄位分隔符號分隔不同的檔名
// 預設的小精靈圖案取自 openclipart (https://openclipart.org/)
//------------------------------
paper = 'alien.png##angel.png##base.png##billy.png##borg.png##bricky.png##camouflage.png##candy.png##chef.png';

//------------------------------
// 每一格的黑色外框線粗細大小
//------------------------------
blackborder = 5


//------------------------------
//Google TTS 文字轉語音的設定
//------------------------------
//合成語音的語言代碼:  'en-US' 'zh-TW'
//------------------------------
tts_language = 'zh-TW';

//------------------------------
//合成語音的速度 0 ~ 1 (可用小數)
//------------------------------
tts_speed = 0.75;  


//----------------------------------
//分隔符號設定
//----------------------------------

//----------------------------------
//欄位分隔符號為兩個井字號(##), paper用的也是這個
//----------------------------------
seperator = '##';

//------------------------------
//題目素材分隔符號
//------------------------------
seperator2 = '~~';

